class CMS extends React.Component {

   constructor(props) {
      super(props);

      this.initData = this.initData.bind(this);
   }

   render() {
      return(
         <div>
            <h2>CMS</h2>
            { this.props.location.state.loginInfo[0]._id }
         </div>
      )
   }
}

export default CMS;
